import React from 'react'

const SingleHourBox = ({hour, enableButton}) => {
  return (
    <div 
    onClick={enableButton}
    style={{backgroundColor: hour.reserved? "#990000" : "white"}}

    >Hour: { hour.hour}</div>
  )
}

export default SingleHourBox
